export const Committees = (props) => {
    return (
        <div className="container">
            <div className="row">
                <h1 style={{textAlign: 'center', margin: '2em 1em 1em 1em', color: '#5ca9fb'}}>Committees</h1>
            </div>
            <Gallery data={props.data}></Gallery>
        </div>
    )
}
